import React from 'react';

function Header() {
  const HeaderButton = [
    { text: "Home", id: 1, url: "/" },
    { text: "Blog Post", id: 2, url: "/" },
    { text: "About", id: 3, url: "/" },
    { text: "Contact", id: 4, url: "/" },
    { text: "Resume", id: 5, url: "/" },
  ];

  return (
    <div className="bg-green-300">
      <div className="flex gap-4 justify-end items-center py-3 pr-3">
        {HeaderButton.map((button) => (
            <a key={button.id} href={button.url} className=" m-0 border-[1px] text-sm font-serif font-bold text-white rounded-full px-5 py-3 align-middle">{button.text}</a>
        ))}
      </div>
    </div>
  );
}

export default Header;
